The TooltipContext is a React Context that holds the state of the Tooltip and the functions to open and close the Tooltip.

Here is an example of a TooltipContext:
```
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [isOpen, setIsOpen] = useState(false);
  const [content, setContent] = useState('');

  const openTooltip = (content) => {
    setContent(content);
    setIsOpen(true);
  };

  const closeTooltip = () => {
    setIsOpen(false);
  };

  return (
    <TooltipContext.Provider value={{ isOpen, content, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```
