The Tooltip component is a component that uses the TooltipContext to open and close the Tooltip. It also renders the content of the Tooltip.

Here is an example of a Tooltip component:
```
import React, { useContext } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = () => {
  const { isOpen, content, openTooltip, closeTooltip } = useContext(TooltipContext);

